CREATE DEFINER=`root`@`localhost` FUNCTION `isEnoughGoals`(a_match_id BIGINT, a_team_action INT) RETURNS varchar(1) CHARSET utf8
BEGIN
	DECLARE l_action_goal INT;
    DECLARE l_action_penalty INT;
    DECLARE l_action_own_goal INT;
    DECLARE l_available_goals INT;
    DECLARE l_current_goals INT;
    
    SET l_action_goal = (select a.id from `action` a where a.action_name = 'Гол');
    SET l_action_penalty = (select a.id from `action` a where a.action_name = 'Пенальти');
    SET l_action_own_goal = (select a.id from `action` a where a.action_name = 'Автогол');
    SET l_available_goals = (select if(m.team_home = a_team_action, m.goals_home, m.goals_guest) from `match` m where m.id = a_match_id);
	SET l_current_goals = ifnull((select count(1) 
						   from player_in_match pm, action_in_match am
                           where pm.match_id = a_match_id 
							 and pm.team_id = a_team_action
							 and pm.match_id = am.match_id
                             and pm.player_id = am.player_id
							 and am.action_id in (l_action_goal, l_action_penalty)
                             group by pm.team_id
                             ), 0) + ifnull((select count(1) 
						   from player_in_match pm, action_in_match am
                           where pm.match_id = a_match_id 
							 and pm.team_id <> a_team_action
							 and pm.match_id = am.match_id
                             and pm.player_id = am.player_id
							 and am.action_id = l_action_own_goal
                             group by am.action_id), 0);
	IF (l_current_goals < l_available_goals) THEN
		return 'N';
    ELSE 
		return 'Y';
    END IF;
                             
END ;;
DELIMITER ;
