CREATE DEFINER=`root`@`localhost` PROCEDURE `addActionGoal`(a_match_id BIGINT, a_player_id INT, a_player_assist INT, a_time_action VARCHAR(5))
BEGIN
	DECLARE l_team_action INT;
    DECLARE l_action INT;
    
    SET l_team_action = (select pm.team_id from player_in_match pm where pm.match_id = a_match_id and pm.player_id = a_player_id);
    SET l_action = (select a.id from `action` a where a.action_name = 'Гол');
    
	IF (l_team_action is not null) THEN
		IF (isEnoughGoals(a_match_id, l_team_action) = 'N') THEN
			insert into action_in_match (match_id, player_id, time, action_id, player_assist_id)
			values (a_match_id, a_player_id, a_time_action, l_action, a_player_assist);
		ELSE
			SIGNAL SQLSTATE '02000' SET MESSAGE_TEXT = 'Goals enough';
		END IF;
    ELSE
		SIGNAL SQLSTATE '02000' SET MESSAGE_TEXT = 'Player not played';
    END IF;
END ;;
