CREATE DEFINER=`root`@`localhost` PROCEDURE `addScheduleWithMatchUrl`(a_league_id INT, a_stadium_name VARCHAR(100), a_date_time VARCHAR(100), a_match_url VARCHAR(100))
BEGIN
	
    DECLARE l_match_id BIGINT;
    SET l_match_id = (select id from `match` m where m.match_url = a_match_url);
    
    IF l_match_id is not null THEN
		INSERT INTO `schedule`(league_id, stadium_id, game_date, match_id)
		SELECT a_league_id, (select id from stadium where league_id = a_league_id and name = a_stadium_name), a_date_time, l_match_id;
		
		update `match`
		set played = 1
		where id = l_match_id;
    ELSE 
		SIGNAL SQLSTATE '02000' SET MESSAGE_TEXT = 'match not found';
    END IF;
    
END ;;
